import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
       <nav className="navbar">
        <ul>Solutions</ul>
        <ul>Solutions</ul>
        <ul>Solutions</ul>
        <ul><button className="btn1">Admin Login</button></ul>
      </nav>
      <div className="logo">
        <h1>AIIMS Dashboard.</h1>
      </div>
    </div>
  );
}

export default App;
